//Audiopredict function - 
//Reference: https://www.w3schools.com/howto/howto_js_autocomplete.asp
function autocomplete(inp, arr) {
  var currentFocus;
  inp.addEventListener("input", function(e) {
      var a, b, i, val = this.value;
      closeAllLists();
      if (!val) { return false;}
      currentFocus = -1;
      a = document.createElement("DIV");
      a.setAttribute("id", this.id + "autocomplete-list");
      a.setAttribute("class", "autocomplete-items");
      this.parentNode.appendChild(a);
      for (i = 0; i < arr.length; i++) {
        if (arr[i].substr(0, val.length).toUpperCase() == val.toUpperCase()) {
          b = document.createElement("DIV");
          b.innerHTML = "<strong>" + arr[i].substr(0, val.length) + "</strong>";
          b.innerHTML += arr[i].substr(val.length);
          b.innerHTML += "<input type='hidden' value='" + arr[i] + "'>";
              b.addEventListener("click", function(e) {
              inp.value = this.getElementsByTagName("input")[0].value;
              document.getElementById("myBtn").click();
              closeAllLists();
          });
          a.appendChild(b);
        }
      }
  });
  inp.addEventListener("keydown", function(e) {
      var zz = document.getElementById(this.id + "autocomplete-list");
      if (zz) zz = zz.getElementsByTagName("div");
      if (e.keyCode == 40) {
        currentFocus++;
        addActive(zz);
      } else if (e.keyCode == 38) {

        currentFocus--;
        addActive(zz);
      } else if (e.keyCode == 13) {
        e.preventDefault();
        if (currentFocus > -1) {
          if (zz) zz[currentFocus].click();
        }
      }
  });
  function addActive(zz) {
    if (!zz) return false;
    removeActive(zz);
    if (currentFocus >= zz.length) currentFocus = 0;
    if (currentFocus < 0) currentFocus = (zz.length - 1);
    zz[currentFocus].classList.add("autocomplete-active");
  }
  function removeActive(zz) {
    for (var i = 0; i < zz.length; i++) {
      zz[i].classList.remove("autocomplete-active");
    }
  }
  function closeAllLists(elmnt) {
    var zz = document.getElementsByClassName("autocomplete-items");
    for (var i = 0; i < zz.length; i++) {
      if (elmnt != zz[i] && elmnt != inp) {
      zz[i].parentNode.removeChild(zz[i]);
    }
  }
}
document.addEventListener("click", function (e) {
    closeAllLists(e.target);
});
}


